import { useEffect } from "react";
import { pingServer } from "./api/test";

function App() {
  useEffect(() => {
    pingServer()
      .then((data) => console.log("Ответ от сервера:", data))
      .catch((err) => console.error("Ошибка при запросе:", err));
  }, []);

  return (
    <div className="App">
      <h1>Promo Lombardia</h1>
      <p>Benvenuti sul sito distribuzione volantini!</p>
    </div>
  );
}

export default App;
